                    الناس
                    عليه صدقةٌ،
                    كل يومٍ تطلع فيه الشمس: تعدل بين اثنين صدقةٌ، وتعين الرجل في دابته فتحمله عليها أو ترفع له متاعه
                    صدقةٌ،
                    والكلمة الطيبة صدقةٌ، وبكل خطوةٍ تمشيها إلى الصلاة صدقةٌ، وتميط الأذى عن الطريق صدقةٌ))؛ رواه
                    البخاري
                    ومسلم.
                </p> --}}
